import Home from './Components/Home';
import NavbarHome from './Components/NavbarHome';
function App() {
  return (
    <>
    <withRouter>
      <BrowserRouter>
        {/* <Navbar/>
        <Switch>
          <Route exact path='/' component={Login} ></Route>
          <Route path='/Signup' component={Signup}></Route>
        </Switch> */}
        {/* <NavbarHome />
